import { Grid, Typography,makeStyles, Card, CardMedia } from '@material-ui/core'
import React from 'react'

const useStyles = makeStyles((theme) =>({
text:{
    fontFamily:'Rosarivo',
    fontSize:'50px',
    padding:theme.spacing(3)
}
}))
function Home() {
    const classes=useStyles();
    return (
        <div>
        <Grid>
            <Typography variant='h1' container='h5' className={classes.text}>
                Welcome to E-commerce Page
            </Typography>
            <CardMedia
            component='img'
            height='400'
            image='https://images.pexels.com/photos/5632402/pexels-photo-5632402.jpeg?cs=srgb&dl=pexels-karolina-grabowska-5632402.jpg&fm=jpg'/>

        </Grid>
        <Grid>

        </Grid>
        </div>
    )
}

export default Home
